INSERT INTO `configuration_webs` VALUES (1,'Twitter account','organichustler',0,'1970-02-01 00:00:00','2017-12-26 14:51:49',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2,'Facebook account','organichustler',0,'1970-02-01 00:00:00','2017-12-26 14:51:58',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(3,'Instagram account','organichustler',0,'1970-02-01 00:00:00','2017-12-26 14:52:02',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(4,'Main product','178',1,'1970-02-01 00:00:00','2019-05-29 04:58:16',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(5,'Product 1','178',1,'1970-02-01 00:00:00','2019-05-29 04:58:22',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(6,'Product 2','178',1,'1970-02-01 00:00:00','2019-05-29 04:58:33',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(7,'TERMS AND CONDITIONS','YOUR TERMS AND CONDITIONS GO HERE',0,'1970-02-01 00:00:00','2018-07-27 14:16:56',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(8,'Youtube account','organichustler',0,'1970-02-01 00:00:00','1970-01-02 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(9,'Email account','organichustler@oh.com',0,'1970-02-01 00:00:00','1970-02-01 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(10,'ABOUT US','Organic Hustler is a trendy fashion design company creating casual unisex urban clothing for men and women who are street wear enthusiasts. The company’s unique designs bridge the gap between the roots of urban life and leading an organic lifestyle. With a keen insight on trends and through its sustainable fashions, the company is dedicated to encouraging people to live life to the fullest and embrace the world. \"I invested in some equipment to print for promo and make some money. The equipment sat idle for maybe 4 to 6 months before i started getting inquiries, so I opened it up and began learning to use it. At this point of my life I was living an organic vegetarian diet, developing an eco mindedness, I cut out designer shopping and felt a sense to pursue progress as an entrepreneur. Once the necessity to make ends meet, met with a feeling of moxy, ambition, originality and spirit of the american hustle -  The idea was born. Organic Hustler!! It was like a vision came to me for the design - the organic word had to be a certain cursive as if lightning wrote it. And the word Hustler all capital and bold.\" - MATE',0,'1970-02-01 00:00:00','2018-02-02 03:16:09',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(11,'CONTACT US FORM','<p>Not sure about your size? Need to see if your item is still in stock?</p>\n\n<p>Send us a message and our team will get in touch to answer any questions.</p>\n\n<p>Customer service:</p>\n\n<p><strong>Monday - Friday</strong></p>\n\n<p><strong>8 AM - 5 PM PST</strong></p>\n\n<p><strong>Saturday - Sunday</strong></p>\n\n<p><strong>8 AM - 2 PM PST</strong></p>\n\n<p>If we receive your email&nbsp;within&nbsp;non-business hours, we will respond within 24 business hours.</p>\n',2,'1970-02-01 00:00:00','2018-01-11 22:04:37',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(12,'Showcase products','[\"178\"]',3,'1970-02-02 00:00:00','2019-05-29 04:58:44',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(13,'Main image','picture',4,'1970-02-01 00:00:00','2018-07-22 18:08:54','IMG_2237.jpeg','image/jpeg',3775193,'2018-07-22 18:08:46',NULL,NULL,NULL,NULL),(14,'Shop men','picture',4,'1970-02-03 00:00:00','2018-08-13 12:55:13','IMG_4060.jpeg','image/jpeg',101243,'2018-08-13 12:55:11',NULL,NULL,NULL,NULL),(15,'Shop women','picture',4,'1970-02-03 00:00:00','2018-07-22 18:10:49','Organic_Hustler-Woman_Shopping_Bag.jpg','image/jpeg',2382583,'2018-07-22 18:10:38',NULL,NULL,NULL,NULL),(16,'Full collection','picture',4,'1970-02-03 00:00:00','2018-07-22 18:12:13','Ashley_modeling_dad_hat.jpeg','image/jpeg',180205,'2018-07-22 18:12:11',NULL,NULL,NULL,NULL),(17,'Instagram','picture',4,'1970-02-03 00:00:00','2018-07-22 18:12:56','IMG-20170709-WA0000.jpg','image/jpeg',184693,'2018-07-22 18:12:53',NULL,NULL,NULL,NULL),(18,'Twitter','picture',4,'1970-02-03 00:00:00','2018-07-22 18:13:18','IMG_4037.jpg','image/jpeg',245542,'2018-07-22 18:13:15',NULL,NULL,NULL,NULL),(19,'Triangle','<p>Clothing - For the solid,<br />\nselfmode individual with root<br />\ninstincts to pursue their goals.<br />\n&quot;By Any Means.&quot;</p>\n',2,'1970-02-03 00:00:00','2018-10-17 15:29:54','',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(20,'Main title','FASHIONABLY CONSCIOUS',0,'1970-02-01 00:00:00','2018-07-22 19:43:39','',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(21,'Full story','picture',4,'1970-02-01 00:00:00','2018-07-22 18:15:10','IMG_4060.jpg','image/jpeg',205545,'2018-07-22 18:15:08',NULL,NULL,NULL,NULL),(22,'Video 1','video',5,'1970-02-01 00:00:00','2018-07-22 18:20:49',NULL,NULL,NULL,NULL,'about_us_mp4_720p.m4v','video/mp4',75636431,'2018-07-22 18:19:48'),(23,'Show \"Video 1\"','true',6,'1970-02-01 00:00:00','2018-07-22 19:43:47',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(24,'LOGO','picture',4,'1970-02-03 00:00:00','2018-07-22 18:15:50','logo.png','image/png',198832,'2018-07-22 18:15:43',NULL,NULL,NULL,NULL),(25,'TERMS OF USE','These are the terms of use',0,'1970-02-03 00:00:00','2018-08-09 00:21:25',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
